<template>
  <div class="main-container">
    <!-- 搜索框部分 -->
    <div class="search-wrapper">
      <el-input 
        v-model="searchQuery" 
        placeholder="搜索项目" 
        class="search-input"
        @keyup.enter="performSearch">
        <template #append>
          <el-button @click="performSearch">搜索</el-button>
        </template>
      </el-input>
    </div>

    <!-- 卡片容器 -->
    <div class="card-container">
      <el-card 
        v-for="project in filteredProjects" 
        :key="project.id" 
        class="project-card" 
        shadow="hover">
        <div class="card-content">
          <!-- 卡片标题区 -->
          <div class="card-header">
            <h3>{{ project.name }}</h3>
            <el-tag 
              :type="getStatusType(project.status)" 
              class="status-tag">
              {{ project.status }}
            </el-tag>
          </div>
          
          <!-- 卡片主体区 -->
          <div class="card-body">
            <p class="card-description">{{ decodeBase64Text(project.description.text) }}</p>
            <img 
              v-if="project.description.image && project.description.image.trim() !== ''" 
              :src="`data:image/png;base64,${project.description.image}`" 
              alt="项目图片" 
              class="card-image" />
          </div>

          <!-- 卡片底部按钮 -->
          <div class="card-footer">
            <el-button 
              :type="project.status === '待评估' ? 'primary' : 'success'"
              @click="handleButtonClick(project)">
              {{ project.status === '待评估' ? '去评估' : '查看结果' }}
            </el-button>
          </div>
        </div>
      </el-card>
    </div>
  </div>
</template>
  
  
  <script lang="ts">
  export default {
    data() {
      return {
        searchQuery: '',
        projects: [
          { "id": 1,
        "name": "项目A",
        "description": {
        "text": "5ZWm5ZWm5ZWm5ZWm5ZWm5ZWm5ZWm5ZWm5ZWm",
        "image": ""
                },
        "status": "待评估" },
        { "id": 2,
        "name": "项目B",
        "description": {
        "text": "6L+Z5piv5LiA5byg5Zu+54mH5Zeh5Zeh5Zeh5Zeh5Zeh5Zeh",
        "image": ""
                },
        "status": "待审查" },
        { "id": 3,
        "name": "项目C",
        "description": {
        "text": "5ZWm5ZWm5ZWm5ZWm5ZWm5ZWm5ZWm5ZWm5ZWm",
        "image": ""
                },
        "status": "已完成" }
          // ... 其他项目
        ],
        filteredProjects: [] // 用于存储搜索结果
      };
    },
    mounted() {
      // 初始化为显示所有项目
      this.filteredProjects = this.projects;
    },
    methods: {
        decodeBase64Text(base64Text) { 
  try {
    const binaryString = atob(base64Text); // 解码 Base64 为二进制字符串
    // 将二进制字符串转换为 UTF-8 编码的文本
    const utf8Text = decodeURIComponent(
      Array.from(binaryString)
        .map(char => `%${char.charCodeAt(0).toString(16).padStart(2, '0')}`)
        .join('')
    );
    return utf8Text;
  } catch (error) {
    console.error("解码失败：", error);
    return "无法显示内容";
  }
}
,
      getStatusType(status: string) {
        if (status === '待评估') {
          return 'warning';
        } else if (status === '待审查') {
          return 'info';
        } else if (status === '已完成') {
          return 'success';
        }
      },
      goToEvaluation(projectId: number) {
        this.$router.push({ path: `/accessor2` });
      },
      performSearch() {
  if (!this.searchQuery.trim()) {
    // 如果搜索词为空，显示所有项目
    this.filteredProjects = this.projects;
    return;
  }

  this.filteredProjects = this.projects.filter(project => {
    const projectName = project.name.toLowerCase();
    const searchTerm = this.searchQuery.toLowerCase();
    const decodedDescription = this.decodeBase64Text(project.description.text).toLowerCase();
    
    return projectName.includes(searchTerm) || 
           decodedDescription.includes(searchTerm);
  });
},
      handleButtonClick(project) {
      if (project.status === '待评估') {
        // 跳转到评估页面
        this.$router.push(`/accessor2`);
      } else {
        // 跳转到结果查看页面
        this.$router.push(`/accessor3`);
      }
    },
    },
  };
</script>

